let divOne=document.querySelector(".one"),buttonOne=document.querySelector(".buttonOne"),divTwo=document.querySelector(".two"),btn1=document.querySelector(".show1"),btn2=document.querySelector(".show2"),btn3=document.querySelector(".show3");buttonOne.addEventListener("click",(function(){fetch("https://my-json-server.typicode.com/Kate2111/JS_ajax/countries").then((function(e){for(let[t,n]of e.headers)console.log(t,n);if(200===e.status)return e.json();throw new Error('<img src="../img/error.jpg">')})).then((function(e){let t="";for(let n=0;n<e.length;n++)t+=`\n                        <p>Название: ${e[n].title}</p>\n                    `;divOne.innerHTML=t})).catch((function(e){divOne.innerHTML=e}))})),btn1.addEventListener("click",(function(){fetch("/page/ajax1.html").then(e=>e.text()).then(e=>{divTwo.innerHTML=e})})),btn2.addEventListener("click",(function(){fetch("/page/ajax2.html").then(e=>e.text()).then(e=>{divTwo.innerHTML=e})})),btn3.addEventListener("click",(function(){fetch("/page/ajax3.html").then(e=>e.text()).then(e=>{divTwo.innerHTML=e})}));